import { storiesOf } from "@storybook/react-native";
import { AkIcons } from "../../index";
import { Center, NativeBaseConfigProvider } from "native-base";

storiesOf("Social Icons 2", module)
  .addDecorator((getStory) => (
    <NativeBaseConfigProvider>
      <Center>{getStory()}</Center>
    </NativeBaseConfigProvider>
  ))
  .add("Facebook Icon", () => <AkIcons.SocialIcons.Face />);

